import React, { useState } from 'react'
import './Gethelp.css';


export default function Gethelp() {

    const locationsData = {
        "Indore": [
            { city: "Indore Center 1", url: "https://www.example.com/indore-center-1" },
            { city: "Indore Center 2", url: "https://www.example.com/indore-center-2" },
            { city: "Indore Center 3", url: "https://www.example.com/indore-center-3" }
        ],
        "Betul": [
            { city: "Betul Center 1", url: "https://www.example.com/betul-center-1" },
            { city: "Betul Center 2", url: "https://www.example.com/betul-center-2" }
        ],
        "Ratlam": [
            { city: "Ratlam Center 1", url: "https://www.example.com/ratlam-center-1" },
            { city: "Ratlam Center 2", url: "https://www.example.com/ratlam-center-2" },
            { city: "Ratlam Center 3", url: "https://www.example.com/ratlam-center-3" }
        ],
        "Gwalior": [
            { city: "Gwalior Center 1", url: "https://www.example.com/ratlam-center-1" },
            { city: "Gwalior Center 2", url: "https://www.example.com/ratlam-center-2" }
        ]
    };

    const [selectedLocation, setSelectedLocation] = useState(null);

        const handleLocationChange = (event) => {
        setSelectedLocation(event.target.value);
    };
    return (
        <div>
            <div className='textplacer'>
                <p className='logo1 '>Where are you located ?</p>
            </div>

            <div className='selectContainer scroll'>
                <select className='dropdown' >
                    <option value="Indore">Indore</option>
                    <option value="Betul">Betul</option>
                    <option value="Ratlam">Ratlam</option>
                    <option value="Gwalior">Ratlam</option>

                </select>
            </div>

    <div>
        {selectedLocation && (
          <div className='locations'>
            {locationsData[selectedLocation].map((location, index) => (
              <div key={index} className='locaname'>
                &#8226; {location.city}
                <div className='locamap'>
                  <iframe title={location.city} src={location.url} width="640" height="480"></iframe>
                </div>
              </div>
            ))}
          </div>
        )}
    </div>
    </div>
    )
}
